import React from 'react'

const Artist = (props) => {
	const style = {
		heading: {
			margin:0,
    		padding: 10,
    		display: "inline-block",
    		background: "#333333",
    		color: 'lightgrey',
    		position: 'relative',
    		zIndex: 2,
    		pointerEvents: 'none'
		},
		subheading: {
			justifyContent: "flex-start",
			flex: '0 0 33.333%'
		},
		bioList: {
			textAlign:'left',fontSize:'1.3rem',listStyle:'none'
		},
		bioItem: {

		},
		bioItemSubList: {marginBottom:'1.3em'},
		kontaktBereich: {
			display:'flex',justifyContent:'center',marginTop:'3em'
		},
		kontaktBtn: {fontSize:'1.3em'}
	}

	return (
		<div className="sctn sctn_artist">
			<h1 className="sctn_heading delayed-fallable" style={style.heading}>Hilke Sens</h1>
			<div className="sctn_body">
				<div className="sctn_subheading" style={style.subheading}></div>
				<ul className="bio_list" style={style.bioList}>
					<li className="" style={style.bioItem}>1974 – 1980 Studium der Kunstpädagogik in Berlin</li>
					<li className="" style={style.bioItem}>seit 1999 Dozentin in der Kunstschule Bederkesa (KUBE e.V.)</li>
					<li className="" style={style.bioItem}>2001 (2013) Zweite (erste) Vorsitzende der KUBE e.V.</li>
					<li className="" style={style.bioItem,style.bioItemSubList}><p>seit 2008 Mitglied der Künstlervereinigungen</p><ul><li>„Die Arche“ (Beverstedt)</li><li>„Paradox“ (Lohra)</li><li>„KreDo“ (Donnern)</li></ul></li>
					<li className="" style={style.bioItem}>seit 1998 regelmäßige Ausstellungen im Landkreis Cuxhaven, in Bremerhaven, Worpswede, Bremen, Hamburg, Göttingen, München, Chaumont (Frankreich).</li>
					<li className="" style={style.bioItem}>2018 Teilnahme an den „Ice Art Championship“ in Fairbanks, Alaska</li>
				</ul>	
				<div className="kontakt_bereich" style={style.kontaktBereich}>
					<button className="kontakt" style={style.kontaktBtn}>Kontakt</button>
				</div>
			</div>
		</div>
	)
}

export default Artist
